import React from "react";

function HorizontalnaLista(props)
{
    
    return(
        <ul>
            <StyleSheet 
        scopeSelector="li"
        rules={{
            paddingLeft:20
        }}
        />
            <li>{props.prvi}</li>
            <li>{props.drugi}</li>
            <li>{props.treci}</li>
            <li>{props.cetvrti}</li>
        </ul>
    );
}

export default HorizontalnaLista;
